import Vue from 'vue'
import App from './App.vue'
import vuetify from './plugins/vuetify'
import { mdiYoutube } from '@mdi/js'

class icon extends Component {
  render() {
    return (
      <Icon path={mdiYoutube}
        title="Youtube"
        size={1}
        horizontal
        vertical
        rotate={90}
        color="red"
        spin/>
    )
  }
} 

Vue.config.productionTip = false

new Vue({
  vuetify,
  render: h => h(App)

}).$mount('#app')
